#include <Windows.h>
#include <wincrypt.h>
#include <fstream>
#include <iostream>
#include <iomanip>
#include <string>

using namespace std;

int main()
{
    setlocale(LC_ALL, "RUS");
    
// D:\stim\test.txt
    
    string F;
    string line;

    cout << "–ü—É—Ç—å –∫ —Ñ–∞–π–ª—É: ";
    cin >> F;

    ifstream file(F);  
    if (!file.is_open())
    {
        cout << "–§–∞–π–ª –Ω–µ –æ—Ç–∫—Ä—ã–ª—Å—è" << endl;
    }
    getline(file, line);

    file.close();

    HCRYPTPROV hProv;
    HCRYPTHASH hHash;
    HCRYPTHASH hHash2;

    if(!CryptAcquireContext(&hProv, NULL, NULL, PROV_RSA_FULL, 0))
    {
        cerr << "–î–µ—Å–∫—Ä–∏–ø—Ç–æ—Ä –Ω–µ –ø–æ–ª—É—á–µ–Ω: " << GetLastError();
    }
  

    if (!CryptCreateHash(hProv, CALG_SHA, 0, 0, &hHash))
    {
        cerr << "–•—ç—à-–æ–±—ä–µ–∫—Ç –Ω–µ —Å–æ–∑–¥–∞–Ω: " << GetLastError();
        CryptReleaseContext(hProv, 0);
    }

    if (!CryptCreateHash(hProv, CALG_MD5, 0, 0, &hHash2))
    {
        cerr << "–•—ç—à-–æ–±—ä–µ–∫—Ç –Ω–µ —Å–æ–∑–¥–∞–Ω: " << GetLastError();
        CryptReleaseContext(hProv, 0);
    }


    ALG_ID hashAlgId;
    DWORD hashAlgIdSize = sizeof(hashAlgId);

    if (!CryptGetHashParam(hHash, HP_ALGID, (BYTE*)&hashAlgId, &hashAlgIdSize, 0))
    {
        cerr << "–û—à–∏–±–∫–∞ –ø—Ä–∏ –ø–æ–ª—É—á–µ–Ω–∏–µ –∏–¥–µ–Ω—Ç–∏—Ñ–∏–∫–∞—Ç–æ—Ä–∞ –∞–ª–≥–æ—Ä–∏—Ç–º–∞: " << GetLastError();
        //delete[] fileData;
        CryptDestroyHash(hHash);
        CryptReleaseContext(hProv, 0);
    }

    cout << "–ò–¥–µ–Ω—Ç–∏—Ñ–∏–∫–∞—Ç–æ—Ä –∞–ª–≥–æ—Ä–∏—Ç–º–∞ —Ö–µ—à–∏—Ä–æ–≤–∞–Ω–∏—è: " << hex << hashAlgId << endl;


    LPCSTR pbData = line.c_str();
    if (!CryptHashData(hHash, (BYTE*)pbData, line.size(), 0))
    {
        cerr << "–•—ç—à–∏—Ä–æ–≤–∞–Ω–∏–µ –ø—Ä–æ–≤–∞–ª–∏–ª–æ—Å—å: " << GetLastError();
        CryptDestroyHash(hHash);
        CryptReleaseContext(hProv, 0);
    }

    if (!CryptHashData(hHash2, (BYTE*)pbData, line.size(), 0))
    {
        cerr << "–•—ç—à–∏—Ä–æ–≤–∞–Ω–∏–µ –ø—Ä–æ–≤–∞–ª–∏–ª–æ—Å—å: " << GetLastError();
        CryptDestroyHash(hHash2);
        CryptReleaseContext(hProv, 0);
    }

    
    DWORD hashSize = 0;
    DWORD hashSizeSize = sizeof(hashSize);

    if (!CryptGetHashParam(hHash, HP_HASHSIZE, (BYTE*)&hashSize, &hashSizeSize, 0))
    {
        cerr << "–û—à–∏–±–∫–∞ –ø—Ä–∏ –ø–æ–ª—É—á–µ–Ω–∏–µ –ø–∞—Ä–∞–º–µ—Ç—Ä–∞ : " << GetLastError();
        CryptDestroyHash(hHash);
        CryptReleaseContext(hProv, 0);
    }

    BYTE* hashData = new BYTE[hashSize];
    if (!CryptGetHashParam(hHash, HP_HASHVAL, hashData, &hashSize, 0))
    {
        cerr << "–û—à–∏–±–∫–∞ –ø—Ä–∏ –ø–æ–ª—É—á–µ–Ω–∏–µ —Ö–µ—à–∞: " << GetLastError();
        delete[] hashData;
        CryptDestroyHash(hHash);
        CryptReleaseContext(hProv, 0);
    }

    cout << "–•—ç—à: ";
    for (DWORD i = 0; i < hashSize; i++)
    {
        cout << setw(2) << setfill('0') << hex << (int)hashData[i];
    }
    cout << endl;



    DWORD hashSize2 = 0;
    DWORD hashSizeSize2 = sizeof(hashSize2);

    if (!CryptGetHashParam(hHash2, HP_HASHSIZE, (BYTE*)&hashSize2, &hashSizeSize2, 0))
    {
        cerr << "–û—à–∏–±–∫–∞ –ø—Ä–∏ –ø–æ–ª—É—á–µ–Ω–∏–µ –ø–∞—Ä–∞–º–µ—Ç—Ä–∞ : " << GetLastError();
        CryptDestroyHash(hHash2);
        CryptReleaseContext(hProv, 0);
    }

    BYTE* hashData2 = new BYTE[hashSize2];
    if (!CryptGetHashParam(hHash2, HP_HASHVAL, hashData2, &hashSize2, 0))
    {
        cerr << "–û—à–∏–±–∫–∞ –ø—Ä–∏ –ø–æ–ª—É—á–µ–Ω–∏–µ —Ö–µ—à–∞: " << GetLastError();
        delete[] hashData2;
        CryptDestroyHash(hHash2);
        CryptReleaseContext(hProv, 0);
    }

    cout << "–•—ç—à: ";
    for (DWORD i = 0; i < hashSize2; i++)
    {
        cout << setw(2) << setfill('0') << hex << (int)hashData2[i];
    }
    cout << endl;


    delete[] hashData;
    delete[] hashData2;
    CryptDestroyHash(hHash);
    CryptDestroyHash(hHash2);
    CryptReleaseContext(hProv, 0);
    return 0;
}

